import{_ as e,o as i,c as a,R as t}from"./chunks/framework.zUbWieqp.js";const l="/assets/jie1.snny-I4y.png",r="/assets/jie2.jX1rP4Xl.png",n="/assets/jie3.Z4Bwak2h.png",s="/assets/jie4.Dbco6ItF.png",o="/assets/jie5.uSm7_sON.png",c="/assets/jie6.NnO3Syd3.png",p="/assets/jie7.1Zeua-Cc.png",d="/assets/jie8.fQvFwJhs.png",h="/assets/jie9.2azg4xyR.png",g="/assets/jie10.faxkxmQ_.png",m="/assets/jie11.ETQhVF-g.png",O=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"guide/Database/rabbitmq/8-界面介绍.md","filePath":"guide/Database/rabbitmq/8-界面介绍.md","lastUpdated":1710405635000}'),u={name:"guide/Database/rabbitmq/8-界面介绍.md"},_=t('<p>默认的初始用户名和密码为：<strong>guest</strong></p><blockquote><p>注意：RabbitMQ的管理后台的端口是15672，RabbitMQ监听的端口是5672，要连接RabbitMQ为5672端口</p></blockquote><h2 id="_1-overview-总览-界面介绍" tabindex="-1">1.Overview(总览)界面介绍 <a class="header-anchor" href="#_1-overview-总览-界面介绍" aria-label="Permalink to &quot;1.Overview(总览)界面介绍&quot;">​</a></h2><p><img src="'+l+'" alt=""></p><ul><li>RabbitMQ以及Erlang安装的版本号:RabbitMQ xxx、Erlang xxx。</li><li>右上角可以设置页面&quot;刷新时间&quot;(5秒、10秒、30秒、不刷新几个选项)。选择监听的&quot;虚拟主机&quot;。节点的名称。登录的用户</li></ul><h3 id="_1-1-overview-totals" tabindex="-1">1.1 Overview -&gt; Totals <a class="header-anchor" href="#_1-1-overview-totals" aria-label="Permalink to &quot;1.1 Overview -&gt; Totals&quot;">​</a></h3><p><img src="'+r+'" alt=""></p><ul><li>如果有消息的话就会有相应的图形展示情况。 <ul><li>Ready：待消费的消息总数</li><li>Unacked：待应答的消息总数</li><li>Total：总数 Ready+Unacked</li><li>Disk read：queue从磁盘读取消息的速率</li><li>Disk write：queue从磁盘写入消息的速率</li></ul></li><li>Global counts <ul><li>Connections：client的tcp连接的总数</li><li>Channels：通道的总数</li><li>Exchanges: 交换器的总数</li><li>Queues：队列的总数</li><li>Consumers：消费者的总数</li></ul></li></ul><h3 id="_1-2-overview-node" tabindex="-1">1.2 Overview -&gt; Node <a class="header-anchor" href="#_1-2-overview-node" aria-label="Permalink to &quot;1.2 Overview -&gt; Node&quot;">​</a></h3><p><img src="'+n+'" alt=""></p><p><strong>Broker的属性</strong></p><ul><li>Name：broker名称</li><li>File descriptors：broker打开的文件描述符和限制。</li><li>Socket descriptors：broker管理的网络套接字数量和限制。当限制被耗尽时，RabbitMQ将停止接受新的网络连接。</li><li>Erlang processes：erlang启动的进程数。</li><li>Memory：当前broker占用的内存。</li><li>Disk space：当前broker占用的硬盘。</li><li>Uptime：当前broker持续运行的时长。</li><li>Info：集群的信息。</li><li>Reset stats：重启单节点或整个集群</li></ul><h3 id="_1-3-overview-ports-and-contexts" tabindex="-1">1.3 Overview -&gt; Ports and contexts <a class="header-anchor" href="#_1-3-overview-ports-and-contexts" aria-label="Permalink to &quot;1.3 Overview -&gt; Ports and contexts&quot;">​</a></h3><p><img src="'+s+'" alt=""></p><ul><li>amqp：与应用通信端口：5672</li><li>clustering：与集群通信端口：25672</li><li>web contexts：管控台端口号：15672</li></ul><h3 id="_1-4-overview-export-definitions" tabindex="-1">1.4 Overview -&gt; Export definitions <a class="header-anchor" href="#_1-4-overview-export-definitions" aria-label="Permalink to &quot;1.4 Overview -&gt; Export definitions&quot;">​</a></h3><p><img src="'+o+'" alt=""></p><p>定义由<strong>用户</strong>，<strong>虚拟主机</strong>，<strong>权限</strong>，<strong>参数</strong>，<strong>交换</strong>，<strong>队列</strong>和<strong>绑定</strong>组成。 它们不包括队列的内容或集群名称。 独占队列不会被导出</p><h3 id="_1-5-overview-import-definitions" tabindex="-1">1.5 Overview -&gt; Import definitions <a class="header-anchor" href="#_1-5-overview-import-definitions" aria-label="Permalink to &quot;1.5 Overview -&gt; Import definitions&quot;">​</a></h3><p><img src="'+c+'" alt=""></p><p>导入的定义将与当前定义合并。 如果在导入过程中发生错误，则所做的任何更改都不会回滚</p><h2 id="_2-connections-连接-界面介绍" tabindex="-1">2. Connections(连接)界面介绍 <a class="header-anchor" href="#_2-connections-连接-界面介绍" aria-label="Permalink to &quot;2. Connections(连接)界面介绍&quot;">​</a></h2><p><img src="'+p+'" alt=""></p><p><strong>连接的属性</strong></p><ul><li>Virtual host：所属的虚拟主机</li><li>Name：名称</li><li>User name：使用的用户名</li><li>State：当前的状态，running：运行中；idle：空闲</li><li>SSL/TLS：是否使用ssl进行连接</li><li>Protocol：使用的协议</li><li>Channels：创建的channel的总数</li><li>From client：每秒发出的数据包</li><li>To client：每秒收到的数据包</li><li>Channels当前连接所有创建的通道</li></ul><h3 id="_2-1-channels-信道-界面介绍" tabindex="-1">2.1 Channels(信道)界面介绍 <a class="header-anchor" href="#_2-1-channels-信道-界面介绍" aria-label="Permalink to &quot;2.1 Channels(信道)界面介绍&quot;">​</a></h3><p><img src="'+d+'" alt=""></p><p><strong>通道的属性</strong></p><ul><li>channel：名称</li><li>Node：节点名称</li><li>Virtual host：所属的虚拟主机</li><li>User name：使用的用户名</li><li>Mode：渠道保证模式。 可以是以下之一，或者不是：C: confirm。T：transactional(事务)</li><li>State ：当前的状态，running：运行中；idle：空闲</li><li>Unconfirmed：待confirm的消息总数</li><li>Prefetch：设置的prefetch的个数</li><li>Unacker：待ack的消息总数</li><li>publish：producter pub消息的速率</li><li>confirm：producter confirm消息的速率</li><li>deliver/get：consumer 获取消息的速率</li><li>ack：consumer ack消息的速率</li></ul><h3 id="_2-2-exchanges-交换机-界面介绍" tabindex="-1">2.2 Exchanges(交换机)界面介绍 <a class="header-anchor" href="#_2-2-exchanges-交换机-界面介绍" aria-label="Permalink to &quot;2.2 Exchanges(交换机)界面介绍&quot;">​</a></h3><p><img src="'+h+'" alt=""></p><p><strong>交换器属性</strong></p><ul><li>Virtual host：所属的虚拟主机</li><li>Name：名称</li><li>Type：exchange type <ul><li>direct exchange 直连，一对一</li><li>topic exchange 可以使用通配符(#---&gt;0个或者多个单词, *---&gt;1个单词，如：tom.# ,单词是word以. 隔开称为一个单词) 过滤</li><li>fanout exchange 广播</li></ul></li><li>Features：功能。 可以是以下之一，或者不是：D: 持久化。T：Internal，存在改功能表示这个exchange不可以被client用来推送消息，仅用来进行exchange和exchange之间的绑定，否则可以推送消息也可以绑定。</li><li>Message rate in：消息进入的速率</li><li>Message rate out：消息出去的速率</li></ul><h3 id="_2-3-queues-队列-界面介绍" tabindex="-1">2.3 Queues(队列)界面介绍 <a class="header-anchor" href="#_2-3-queues-队列-界面介绍" aria-label="Permalink to &quot;2.3 Queues(队列)界面介绍&quot;">​</a></h3><p><img src="'+g+'" alt=""></p><p><strong>队列的属性</strong></p><ul><li>Virtual host：所属的虚拟主机。</li><li>Name：名称。</li><li>Features：功能。 可以是以下之一，或者不是：D: 持久化。</li><li>State：当前的状态，running：运行中；idle：空闲。</li><li>Ready：待消费的消息总数。</li><li>Unacked：待应答的消息总数。</li><li>Total：总数 Ready+Unacked。</li><li>incoming：消息进入的速率。</li><li>deliver/get：消息获取的速率。</li><li>ack：消息应答的速率</li></ul><h3 id="_2-4-admin-用户管理-界面介绍" tabindex="-1">2.4 Admin(用户管理)界面介绍 <a class="header-anchor" href="#_2-4-admin-用户管理-界面介绍" aria-label="Permalink to &quot;2.4 Admin(用户管理)界面介绍&quot;">​</a></h3><p><img src="'+m+'" alt=""></p><p><a href="https://mp.weixin.qq.com/s?__biz=MzIwMTg3NzYyOA==&amp;mid=2247483867&amp;idx=1&amp;sn=c8abadc68fd40a662d7992a941d9a6e1&amp;chksm=96e670c8a191f9de5f6a663eb44a905397526c94fa1dd929091644be4b4c24251eef82efb48e&amp;token=822843029&amp;lang=zh_CN#rd" target="_blank" rel="noreferrer">https://mp.weixin.qq.com/s?__biz=MzIwMTg3NzYyOA==&amp;mid=2247483867&amp;idx=1&amp;sn=c8abadc68fd40a662d7992a941d9a6e1&amp;chksm=96e670c8a191f9de5f6a663eb44a905397526c94fa1dd929091644be4b4c24251eef82efb48e&amp;token=822843029&amp;lang=zh_CN#rd</a></p>',40),b=[_];function v(f,x,k,q,w,P){return i(),a("div",null,b)}const N=e(u,[["render",v]]);export{O as __pageData,N as default};
